script: |
  super -f text -I q2012.spq | sort > q2012.out

inputs:
  - name: q2012.spq
    data: |
      SELECT DISTINCT - col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - 31 * + col2 NOT BETWEEN - 3 * 9 * + col0 - 39 + - col2 AND ( 56 );
  - name: tab0

outputs:
  - name: q2012.out
    data: |
      -87
